import React from "react";
import { Card, ListGroupItem, Row } from "react-bootstrap";

const BlogScreenBlogPosts = ({ blog }) => {
  return (
    <Card className="m-3" key={blog._id}>
      <Card.Text className="blog-card-top">{blog.body}</Card.Text>
      <ListGroupItem>
        <Row>
          <Col md={8}>
            {blog.author}
            {blog.createdAt}
          </Col>{" "}
          <Col md={4}>
            {blog.likes.length}
            {blog.comments.length}
          </Col>
        </Row>
      </ListGroupItem>
    </Card>
  );
};

export default BlogScreenBlogPosts;
